import styled from "@emotion/styled";

export const NavbarStyle = styled.div`
  display: flex;
  flex-direction: row;
  flex-wrap: nowrap;
  padding: 15px;
  background-color: green;
`;

export const NavbarLink = styled.a`
  text-decoration: none;
  color: white;
  margin
`;
